'use client';
import { useEffect, useState } from 'react';
import styles from './index.module.css';
import { useSearchParams } from 'next/navigation';
import LocationPicker from '@/components/LocationPicker';

const MAX_CHARS = 1000;

export default function NewProjectModal() {
    const searchParams = useSearchParams();

    useEffect(() => {
        setOpen(searchParams.get('modal') === 'newProject');
    }, [searchParams]);

    const [open, setOpen] = useState(false);
    const [form, setForm] = useState({
        nome: '',
        descricao: '',
        dataConclusao: '',
        area: '',
        pais: '',
        estado: '',
        cidade: '',
        address: '',
        coordinates: ['', ''],
        gallery: '',
        esg: false,
    });
    const [errors, setErrors] = useState({}); // erros por campo

    const fecharModal = () => {
        setOpen(false);

        // Remove query param
        const url = new URL(window.location.href);
        url.searchParams.delete('modal');
        window.history.replaceState({}, '', url);
    };

    if (!open) return null;

    const handleChange = (e) => {
        const { name, value, type, files, checked } = e.target;

        if (name === "descricao") {
            let val = value.slice(0, MAX_CHARS);
            setForm({ ...form, [name]: val });
            if (val.length === MAX_CHARS) {
                setErrors((prev) => ({ ...prev, descricao: "VocÃª atingiu o limite de 1000 caracteres." }));
            } else {
                setErrors((prev) => ({ ...prev, descricao: "" }));
            }
        } else if (type === "file") {
            setForm({ ...form, [name]: '' });
            setErrors((prev) => ({ ...prev, [name]: "" }));
        } else if (type === "checkbox") {
            setForm({ ...form, [name]: checked });
        } else {
            setForm({ ...form, [name]: value });
            setErrors((prev) => ({ ...prev, [name]: "" }));
        }
    };

    const handleSave = async () => {
        const requiredFields = ["nome", "descricao", "dataConclusao", "area", "pais", "estado", "cidade", "address", "gallery"];
        let newErrors = {};

        requiredFields.forEach((field) => {
            if (!form[field] || (typeof form[field] === "string" && form[field].trim() === "")) {
                newErrors[field] = "Campo obrigatÃ³rio";
            }
        });

        if (form.descricao.length > MAX_CHARS) {
            newErrors.descricao = "A descriÃ§Ã£o nÃ£o pode ter mais de 1000 caracteres.";
        }

        setErrors(newErrors);

        if (Object.keys(newErrors).length === 0) {
            console.log("FormulÃ¡rio vÃ¡lido:", form);
            const response = await fetch('http://localhost:3000/api/projects', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(form)
            });

            const data = await response.json();

            console.log(data);
        }
    };

    return (
        <>
            {open && (
                <div className='modal_overlay' onClick={fecharModal}>

                    <div className='modal_container' onClick={(e) => e.stopPropagation()}>
                        <div className='modal_title'>
                            <h2>Adicionar Projeto</h2>
                        </div>
                        <div className={styles.form_group}>
                            <label>TÃ­tulo *</label>
                            <input name="nome" value={form.nome} onChange={handleChange} />
                            {errors.nome && <span style={{ color: "red" }}>{errors.nome}</span>}

                            <label>DescriÃ§Ã£o *</label>
                            <textarea name="descricao" value={form.descricao} onChange={handleChange} />
                            {errors.descricao && <span style={{ color: "red" }}>{errors.descricao}</span>}
                            <span>{form.descricao.length}/{MAX_CHARS} caracteres</span>

                            <label>Data de conclusÃ£o *</label>
                            <input name="dataConclusao" type="month" value={form.dataConclusao} onChange={handleChange} />
                            {errors.dataConclusao && <span style={{ color: "red" }}>{errors.dataConclusao}</span>}

                            <label>Ãrea do Projeto</label>
                            <div className={styles.input_area}>
                                <input
                                    type="number"
                                    name="area"
                                    value={form.area}
                                    onChange={handleChange}
                                    min="0"
                                    max="1000000"
                                />
                                <span>mÂ²</span>
                            </div>
                            {errors.area && <span style={{ color: "red" }}>{errors.area}</span>}

                            <h4>LocalizaÃ§Ã£o</h4>
                            <label>PaÃ­s *</label>
                            <input name="pais" value={form.pais} onChange={handleChange} />
                            {errors.pais && <span style={{ color: "red" }}>{errors.pais}</span>}

                            <label>Estado *</label>
                            <input name="estado" value={form.estado} onChange={handleChange} />
                            {errors.estado && <span style={{ color: "red" }}>{errors.estado}</span>}

                            <label>Cidade *</label>
                            <input name="cidade" value={form.cidade} onChange={handleChange} />
                            {errors.cidade && <span style={{ color: "red" }}>{errors.cidade}</span>}

                            <label>EndereÃ§o completo *</label>
                            <LocationPicker form={form} setForm={setForm} />
                            {errors.address && <span style={{ color: "red" }}>{errors.address}</span>}

                            <h4>Galeria *</h4>
                            <input name="gallery" type='file' onChange={handleChange} />
                            {errors.gallery && <span style={{ color: "red" }}>{errors.gallery}</span>}

                            <div className={styles.checkbox_wrapper_page}>
                                <input name="esg" type='checkbox' checked={form.esg} onChange={handleChange} />
                                <span>Solicitar avaliaÃ§Ã£o ESG</span>
                            </div>
                            <p className={styles.esg_warning}>
                                Marque esta opÃ§Ã£o se deseja que seu projeto seja avaliado quanto Ã s normas de sustentabilidade ESG.
                                Caso aprovado, ele poderÃ¡ receber o selo ESG.
                            </p>

                        </div>
                        <div className={styles.button_group}>
                            <button type="button" className='primary_button' onClick={handleSave}>Salvar</button>
                        </div>
                    </div>
                </div>
            )}
        </>
    );
}